export type SerializedMatchContextPath = string;
export type MatchContextPath = {
    path: MatchContextPathSection[];
};
export type MatchContextPathSection = MatchContextPathRepeatSection;
export type MatchContextPathRepeatSection = {
    /**In sync with struct id. An identifier for the minlayout repeat section being used. */
    structId: number;
    /**The nth time this is being repeated */
    repeatNum: number;
};
